        limitations_match = re.search('limitations\\s+under\\s+the\\s+License\\.', license_text)
        if url_match and permissions_match and limitations_match:
            return {'URL': url_match.group(0), 'permissions': permissions_match.group(0), 'limitations': limitations_match.group(0)}
